import React from 'react'
import Card from '../Card/Card'
import './CardList.css'
const CardList = ({ServiceList}) => {
	return(
		<div className="main">
			<h1>Services</h1>
				{
					ServiceList.map((service, i) => {
						return (
							<a className="img" href="/services">
								<Card
									key={i}
									id={service.id}
									title={service.title}
									image={`${service.image}?size=200x200`}
									description={service.description}
								/>
							</a>
						)
					})
				}
		</div>
	);
}

export default CardList;
